description:
Stark, gripande och bitvis valdsamt actiondrama om en enslig yrkesmordare 
av italienskt ursprung i New York, som blir van med en 12-arig flicka med 
traumatiska upplevelser bakom sig. Den garvade Leon har for forsta gangen 
nagon att bry sig om och hans skyddsling visar snabbt intresse for konsten 
att doda..... 
Med Jean Reno, Gary Oldman, Natalie Portman m fl. 
